import React from 'react';
import { Header } from '../src/Header';
import { Menu } from '../src/Menu';
import OpenCampaign from './OpenCampaign';
function Home({ campaigns, setCampaigns }) {
  return (
    <div>
      <Header />
      <Menu />

      <div className="container">
        <div className="row">
          <div className="col-6">
            <h3>Campaigns List</h3>
            <ul>
              {campaigns.map(({ name, res }) => {
                const { link } = res;
                return (
                  <li>
                    <a href={link}>{name}</a>
                  </li>
                );
              })}
            </ul>
          </div>
          <div className="col-6">
            <OpenCampaign campaigns={campaigns} setCampaigns={setCampaigns} />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
